<div class="modal fade" id="mymodal3" role="dialog">
<div class="modal-content">
<button type="button" class="close" data-dismiss="modal">&times;</button>
<div>
<h3 id="h"></h3>
<img id="photo" src="">
<p id="p"></p>
</div>
</div>
</div>
<script>
getdata();
function getdata()
{
$.post("newsback.php",{
mode:"getdata"
},function(data){
data = JSON.parse(data);
tblRow="";
if(data)
{
for(i in data)
{
tblRow +="<div class='card card-widget col-sm-2 m-2' id='card'><div class='card-header'><img id='img' src="+data[i]['video']+"></div><div class='card-body'><h3><b>"+data[i]['title']+"</b></h3><br><p>"+data[i]['des']+"</p></div>";
tblRow += "<div class='card-footer'><button class='btn mr-2' id='read' data-toggle='modal' data-target='#mymodal3' onclick='read(\""+i+"\")'>Read <i class='fa fa-trash-book'></i></button><button class='btn mr-2' id='edit' data-toggle='modal' data-target='#mymodal2' onclick='select(\""+i+"\")'>Edit <i class='fa fa-edit'></i></button>";
tblRow += "<button class='btn mr-2' id='delete' onclick='deletevalue(\""+i+"\")'>Delete <i class='fa fa-trash-o'></i></button></div></div>";
}
}
$("#display").html(tblRow);
})
}

function select(id)
{
$.post("newsback.php",{
mode:"add",
id:id
},function(data){
datas = JSON.parse(data);
console.log(datas);
for(i in datas){
document.getElementById("dessel").value=datas[0]['des'];
document.getElementById("idid").value=datas[1];
document.getElementById("titlesel").value=datas[0]['title'];
}
})
}

function deletevalue(id)
{
$.post("newsback.php",{
mode:"delete",
id:id
},function(data){
if(data="success"){
swal("data deleted successfully!","Success", "success");
getdata();
}
else{
swal("data not deleted!","Error", "Error");
}
})
}

function read(id){
$.post("newsback.php",{
mode:"add",
id:id
},function(data){
datas = JSON.parse(data);
console.log(datas);
for(i in datas){
document.getElementById("p").innerHTML=datas[0]['des'];
document.getElementById("photo").src=datas[0]['video'];
document.getElementById("h").innerHTML=datas[0]['title'];
}
})
}
</script>

